import React, {useEffect, useState} from 'react';
import axios from 'axios';

const [reviewCow, setReviewCow] = useState([]);

useEffect(() =>{
    axios.get('http://localhost:3001/api/cow-info').then((response) =>{
        setReviewCow(response.data)
    })
}, [])

const Cow_info = () => {


  return (
    <div>
        {reviewCow.map((val)=>{
                return (
                <div>
                    <h3>{val.breed}</h3>
                    <ul>
                        <li> {val.sex} </li>
                        <li> {val.age}</li>
                        <li> {val.color}</li>
                        <li> {val.fathersID} </li>
                        <li> {val.mothersID} </li>
                        <li> {val.height}  </li>
                        <li> {val.weight}  </li>
                        <li> {val.milk}</li>
                        <li> {val.income}</li>
                    </ul> 
                </div>

                )
            })}
    </div>
  )
}

export default Cow_info;
